// Validate input parameters
const item = $input.first();
const body = item.json.body || item.json;

// YouTube URL
const youtubeUrl = body.youtube_url || body.url;
if (!youtubeUrl) {
  throw new Error('Missing required parameter: youtube_url');
}

if (!youtubeUrl.includes('youtube.com') && !youtubeUrl.includes('youtu.be')) {
  throw new Error('Invalid YouTube URL');
}

// Optional segment times (if not provided, downloads full video)
const segmentStart = body.segment_start || null;
const segmentEnd = body.segment_end || null;

if (segmentStart !== null && segmentEnd !== null && segmentEnd <= segmentStart) {
  throw new Error('segment_end must be greater than segment_start');
}

return [{
  json: {
    youtube_url: youtubeUrl,
    segment_start: segmentStart,
    segment_end: segmentEnd,
    format: 'mp3'
  }
}];

// Extract task_id from yttools response
const item = $input.first();
const response = item.json;

if (!response.task_id) {
  throw new Error('yttools did not return task_id: ' + JSON.stringify(response));
}

return [{
  json: {
    task_id: response.task_id,
    youtube_url: $('Validate Input').item.json.youtube_url,
    segment_start: $('Validate Input').item.json.segment_start,
    segment_end: $('Validate Input').item.json.segment_end,
    poll_count: 0,
    max_polls: 120
  }
}];

// Format immediate response with task_id
const item = $input.first();

return [{
  json: {
    status: 'processing',
    task_id: item.json.task_id,
    message: 'Processing started. Poll the status endpoint for updates.',
    poll_url: `https://yttools.lan/api/status/${item.json.task_id}`
  }
}];

// Merge status response with loop data (poll_count, etc.)
const statusResponse = $input.first().json;
const loopData = $('Wait 3s').first().json;

// Merge: status response takes precedence, but preserve poll_count from loop
return [{
  json: {
    ...statusResponse,
    poll_count: loopData.poll_count,
    max_polls: loopData.max_polls,
    task_id: loopData.task_id
  }
}];

// Check if task is complete
const item = $input.first();
const status = item.json;

const taskId = $('Extract Task ID').item.json.task_id;
// Read poll_count from current item (from loop), fallback to Extract Task ID for first iteration
const currentPollCount = item.json.poll_count !== undefined ? item.json.poll_count : $('Extract Task ID').item.json.poll_count;
const pollCount = (currentPollCount || 0) + 1;
const maxPolls = $('Extract Task ID').item.json.max_polls || 120;

if (pollCount >= maxPolls) {
  throw new Error(`Task timeout after ${maxPolls} attempts`);
}

if (status.status === 'completed') {
  return [{
    json: {
      task_id: taskId,
      status: 'completed',
      ready_to_download: true,
      youtube_url: $('Validate Input').item.json.youtube_url,
      segment_start: $('Validate Input').item.json.segment_start,
      segment_end: $('Validate Input').item.json.segment_end,
      result: status.result || {}
    }
  }];
} else if (status.status === 'failed') {
  throw new Error(`yttools task failed: ${status.error || 'Unknown error'}`);
} else {
  return [{
    json: {
      task_id: taskId,
      status: status.status,
      progress: status.progress || 0,
      poll_count: pollCount,
      max_polls: maxPolls,
      ready_to_download: false
    }
  }];
}

