// Parse structured JSON output from Stage 1 AI Agent
// With Structured Output Parser, data comes directly in top-level fields (not wrapped in 'output')
const inputData = $input.first().json;

// Check if we have clips directly (from Structured Output Parser)
if (!inputData.clips) {
  throw new Error('No clips field in AI Agent response. Available fields: ' + JSON.stringify(Object.keys(inputData)));
}

const parsedOutput = inputData; // Data is already structured

// Function to convert SRT timestamp to seconds
function srtToSeconds(timestamp) {
  const [time, ms] = timestamp.split(',');
  const [hours, minutes, seconds] = time.split(':').map(Number);
  return hours * 3600 + minutes * 60 + seconds + (parseInt(ms) / 1000);
}

// Function to convert seconds to SRT timestamp
function secondsToSRT(seconds) {
  const hours = Math.floor(seconds / 3600);
  const minutes = Math.floor((seconds % 3600) / 60);
  const secs = Math.floor(seconds % 60);
  const ms = Math.round((seconds % 1) * 1000);
  return `${String(hours).padStart(2, '0')}:${String(minutes).padStart(2, '0')}:${String(secs).padStart(2, '0')},${String(ms).padStart(3, '0')}`;
}

// Function to sanitize title for filename
function sanitizeTitle(title) {
  return title.toLowerCase().replace(/[^a-z0-9]+/g, '_').replace(/^_+|_+$/g, '');
}

// Extract power words from text (simple heuristic: words in caps, emotional words)
function extractPowerWords(text, title) {
  const emotionalWords = ['trauma', 'guilt', 'shame', 'healing', 'broken', 'safe', 'worthy', 'valid', 'fault'];
  const words = text.toLowerCase().split(/\s+/);
  const found = words.filter(w => emotionalWords.includes(w)).slice(0, 2);

  // Add title words if we don't have enough
  if (found.length < 2) {
    const titleWords = title.split(/\s+/).filter(w => w.length > 4).slice(0, 3 - found.length);
    found.push(...titleWords);
  }

  return found.length > 0 ? found : ['healing', 'trauma'];
}

// Convert from schema format to internal format with synthetic text_styling
const clips = parsedOutput.clips.map(clip => {
  const startSeconds = srtToSeconds(clip.timestamp_start);
  const endSeconds = srtToSeconds(clip.timestamp_end);
  const duration = parseFloat((endSeconds - startSeconds).toFixed(3));

  // Generate synthetic text_styling (will be enhanced by Stage 2 later if needed)
  const ctaStartSeconds = Math.max(startSeconds, endSeconds - 8); // Last 8 seconds
  const hookTitle = clip.title_hook.replace(/\s+/g, '\n').substring(0, 60); // Break into lines

  return {
    index: clip.clip_number,
    title: clip.title_hook,
    title_sanitized: sanitizeTitle(clip.title_hook),
    type: clip.clip_type,
    type_sanitized: sanitizeTitle(clip.clip_type),
    start_timestamp: clip.timestamp_start,
    end_timestamp: clip.timestamp_end,
    start_seconds: startSeconds,
    end_seconds: endSeconds,
    duration: duration,
    text: clip.full_text,
    notes: clip.directors_note,
    text_styling: {
      hook_title_overlay: hookTitle,
      power_words: extractPowerWords(clip.full_text, clip.title_hook),
      cta_start_timestamp: secondsToSRT(ctaStartSeconds),
      cta_promise_text: 'Watch the full video:',
      cta_verbal_cue: ''
    }
  };
});

if (clips.length === 0) {
  throw new Error('No clips found in AI output.');
}

return [{
  json: {
    clips: clips,
    total_clips: clips.length,
    ai_output: JSON.stringify(parsedOutput),
    task_id: $('Extract Task ID').item.json.task_id,
    youtube_url: $('Validate Input').item.json.youtube_url
  }
}];

// Format no-clips-found response
const aiOutput = $input.first().json.output;

return [{
  json: {
    status: 'no_clips_found',
    clips_found: false,
    analysis: aiOutput,
    message: 'No suitable high-impact clips found in this video. The AI analysis explains why.',
    suggestion: 'Try a different video with more educational/teaching content about trauma recovery concepts.'
  }
}];

const whisperxData = JSON.parse($input.first().json.data);
const taskId = $('Extract Task ID').item.json.task_id;

// Convert JSON to binary for file writing
const jsonString = JSON.stringify(whisperxData, null, 2);
const buffer = Buffer.from(jsonString, 'utf-8');

return [{ 
  json: { 
    task_id: taskId 
  },
  binary: {
    data: {
      data: buffer.toString('base64'),
      mimeType: 'application/json',
      fileName: `whisperx_${taskId}.json`
    }
  }
}];

// Extract clips data from merged inputs
// Input 0: Write WhisperX JSON to Temp
// Input 1: Write SRT to Temp  
// Input 2: Pass Through Clips Data (has the actual clips data from Parse AI Clips)
// Input 3: Write Video to Temp

const inputs = $input.all();

// Find the input that has clips data (from Parse AI Clips)
let parseClipsData = null;
for (const input of inputs) {
  if (input.json.clips) {
    parseClipsData = input.json;
    break;
  }
}

if (!parseClipsData || !parseClipsData.clips) {
  throw new Error('Parse AI Clips data not found in merge inputs');
}

return [{
  json: {
    clips: parseClipsData.clips,
    total_clips: parseClipsData.total_clips,
    task_id: parseClipsData.task_id,
    youtube_url: parseClipsData.youtube_url,
    ai_output: parseClipsData.ai_output
  }
}];

// Combine clip data with temp file paths
// After merge, data from all three inputs is combined
const inputData = $input.first().json;

// Get clips data (should come from Parse AI Clips input)
const clips = inputData.clips;
const taskId = inputData.task_id;
const youtubeUrl = inputData.youtube_url;

if (!clips) {
  throw new Error('clips field not found in merged data. Input structure: ' + JSON.stringify(Object.keys(inputData)));
}

const videoPath = `/tmp/video_${taskId}.mp4`;
const srtPath = `/tmp/video_${taskId}.srt`;

return [{
  json: {
    clips: clips,
    total_clips: clips.length,
    task_id: taskId,
    youtube_url: youtubeUrl,
    video_path: videoPath,
    srt_path: srtPath
  }
}];

// Wait for directory creation, then pass through original data
const originalData = $('Add Temp Paths to Data').item.json;
return [{ json: originalData }];

// Build ffmpeg command for extracting and enhancing clip
// Get the original clip data from 'Split Out Clips' node (before Execute Command)
const splitOutData = $('Split Out Clips').item.json;
const data = splitOutData;
const clip = data.clips || data; // Handle both nested and flat structures
const videoPath = data.video_path;
const taskId = data.task_id;
const aiOutput = data.ai_output; // Pass through AI output

// Get video title from YouTube URL or use task ID
const youtubeUrl = data.youtube_url || '';
const videoId = youtubeUrl.match(/(?:v=|youtu\.be\/)([^&\?]+)/)?.[1] || taskId;
const baseFilename = `${videoId}_clip_${String(clip.index).padStart(2, '0')}_${clip.type_sanitized}`;

const outputPath = `/nas/PeggysExtraStorage/videos-to-process/processed/shorts/${baseFilename}.mp4`;
const assPath = `/tmp/subtitle_${taskId}_clip_${String(clip.index).padStart(2, '0')}.ass`;

// Build ffmpeg command with:
// 1. Extract segment (-ss start, -to end)
// 2. Crop to 9:16 vertical format
// 3. Burn-in ASS subtitles with custom styling and text overlays
// 4. Encode with H.264 + AAC
// Build ffmpeg command for extracting clip WITHOUT subtitles
// Subtitles will be added in a later step after WhisperX transcription
const outputPathNoSubs = `/nas/PeggysExtraStorage/videos-to-process/scratch/${baseFilename}_nosubs.mp4`;

const ffmpegCmd = `ffmpeg -y -i \"${videoPath}\" \\
    -ss ${clip.start_seconds} \\
    -to ${clip.end_seconds} \\
    -vf \"crop=ih*9/16:ih\" \\
    -c:v libx264 -crf 23 -preset fast \\
    -c:a aac -b:a 128k \\
    -movflags +faststart \\
    \"${outputPathNoSubs}\"`;

return [{
  json: {
    ...data,
    clip: clip,
    ffmpeg_command: ffmpegCmd,
    output_path_nosubs: outputPathNoSubs,
    output_path_final: outputPath,
    base_filename: baseFilename,
    ass_path: assPath,
    ai_output: aiOutput
  }
}];

// Extract WhisperX transcription for this entire short video clip
// Timestamps now start at 0:00:00 for the clip (not original video time)
const whisperxResult = $input.first().json;
const prepareData = $('Prepare ffmpeg Command').item.json;

// Verify we got segments back
if (!whisperxResult.segments || whisperxResult.segments.length === 0) {
  throw new Error(`WhisperX returned no segments for clip ${prepareData.clip.index}`);
}

console.log(`WhisperX transcribed ${whisperxResult.segments.length} segments for clip ${prepareData.clip.index}`);
console.log(`Duration: ${prepareData.clip.duration}s, Language: ${whisperxResult.language}`);

// Pass through clip data + add WhisperX results
return [{
  json: {
    ...prepareData,
    whisperx_segments: whisperxResult.segments,
    whisperx_srt: whisperxResult.srt,
    whisperx_segments_srt: whisperxResult.segments_srt,
    whisperx_txt: whisperxResult.txt,
    clip_language: whisperxResult.language,
    num_segments: whisperxResult.segments.length
  }
}];

// Generate sentence-aware ASS subtitles directly from WhisperX segments
const data = $input.first().json;
const clip = data.clip;
const taskId = data.task_id;
const segments = data.whisperx_segments;

// ===== CONFIGURATION =====
const CONFIG = {
  wordsToShow: 3,
  fontName: 'Arial',
  fontSize: 80,  // Reduced from 130
  fontColor: 'FFFFFF',
  outlineColor: '000000',
  backgroundColor: '000000',
  highlightFontSize: 100,  // Reduced from 150 (still 25% larger than base for zoom effect)
  highlightColor: '00FFFF',
  bold: 0,
  italic: 0,
  underline: 0,
  strikeout: 0,
  scaleX: 100,
  scaleY: 100,
  spacing: 0,
  angle: 0,
  borderStyle: 1,
  outline: 8,  // Reduced from 10
  shadow: 1,
  alignment: 2,
  marginL: 10,
  marginR: 10,
  marginV: 300,
  videoWidth: 1080,  // 9:16 vertical format
  videoHeight: 1920,
  maxGapTimeMs: 2000,
  // Hook title styling
  hookTitleFontSize: 120,  // Reduced from 180
  hookTitleColor: 'FFFF00',  // Yellow
  hookTitleDuration: 2.0,  // Show for 2 seconds at start
  hookTitleAlignment: 5,  // Center
  hookTitleMarginV: 100,
  // CTA styling
  ctaFontSize: 90,  // Reduced from 140
  ctaColor: 'FF00FF',  // Magenta
  ctaDuration: 8.0,  // Show for last 8 seconds
  ctaAlignment: 8,  // Top center
  ctaMarginV: 100
};

// Helper: convert seconds to ASS time format (H:MM:SS.cs)
function formatTime(sec) {
  const h = Math.floor(sec / 3600);
  const m = Math.floor((sec % 3600) / 60);
  const s = Math.floor(sec % 60);
  const cs = Math.floor((sec - Math.floor(sec)) * 100);
  return `${h}:${m.toString().padStart(2, '0')}:${s.toString().padStart(2, '0')}.${cs.toString().padStart(2, '0')}`;
}

// Creates subtitle text with specified word highlighted
function createSubtitleText(wordGroup, highlightIndex) {
  let line = '';
  wordGroup.forEach((word, i) => {
    if (i > 0) line += ' ';
    if (i === highlightIndex) {
      line += `{\\fs${CONFIG.highlightFontSize}\\c&H${CONFIG.highlightColor}&}${word.word.trim()}{\\r}`;
    } else {
      line += word.word.trim();
    }
  });
  return line;
}

// Process all segments to get all words
let allWords = [];
segments.forEach(segment => {
  if (segment.words && segment.words.length > 0) {
    allWords = allWords.concat(segment.words);
  }
});

// Sort by start time
allWords.sort((a, b) => a.start - b.start);

// Create sentence-aware word groups
function createSentenceAwareGroups(words) {
  const groups = [];
  let currentGroup = [];

  for (let i = 0; i < words.length; i++) {
    const currentWord = words[i];
    currentGroup.push(currentWord);

    const endsWithPeriod = currentWord.word.trim().endsWith('.');

    if (currentGroup.length >= CONFIG.wordsToShow || endsWithPeriod || i === words.length - 1) {
      if (currentGroup.length > 0) {
        groups.push([...currentGroup]);
        currentGroup = [];
      }
    }
  }

  if (currentGroup.length > 0) {
    groups.push(currentGroup);
  }

  return groups;
}

const wordGroups = createSentenceAwareGroups(allWords);
let dialogueLines = [];

// Generate dialogue lines for each word
for (let i = 0; i < allWords.length; i++) {
  const currentWord = allWords[i];

  // Find which group contains this word
  let groupIndex = -1;
  let positionIndex = -1;

  for (let g = 0; g < wordGroups.length; g++) {
    const wordIndex = wordGroups[g].findIndex(w => 
      w.start === currentWord.start && w.end === currentWord.end && w.word === currentWord.word);

    if (wordIndex !== -1) {
      groupIndex = g;
      positionIndex = wordIndex;
      break;
    }
  }

  if (groupIndex === -1) continue;

  const wordGroup = wordGroups[groupIndex];
  const startTime = currentWord.start;
  const endTime = currentWord.end;
  const formattedStart = formatTime(startTime);
  const formattedEnd = formatTime(endTime);
  const subtitleText = createSubtitleText(wordGroup, positionIndex);

  dialogueLines.push({
    start: startTime,
    end: endTime,
    formattedStart,
    formattedEnd,
    text: subtitleText,
    group: groupIndex,
    position: positionIndex
  });
}

// Fill gaps between dialogues in same group
for (let i = 0; i < dialogueLines.length - 1; i++) {
  const current = dialogueLines[i];
  const next = dialogueLines[i + 1];

  if (current.group === next.group && next.start - current.end > 0 && next.start - current.end <= CONFIG.maxGapTimeMs / 1000) {
    current.end = next.start;
    current.formattedEnd = formatTime(current.end);
  }
}

// Build ASS file content with multiple styles
let ass = `[Script Info]
Title: Sentence-Aware Fixed Position Subtitles with Hook and CTA
ScriptType: v4.00+
PlayResX: ${CONFIG.videoWidth}
PlayResY: ${CONFIG.videoHeight}

[V4+ Styles]
Format: Name, Fontname, Fontsize, PrimaryColour, SecondaryColour, OutlineColour, BackColour, Bold, Italic, Underline, StrikeOut, ScaleX, ScaleY, Spacing, Angle, BorderStyle, Outline, Shadow, Alignment, MarginL, MarginR, MarginV, Encoding
Style: Default,${CONFIG.fontName},${CONFIG.fontSize},&H${CONFIG.fontColor},&H${CONFIG.outlineColor},&H${CONFIG.outlineColor},&H${CONFIG.backgroundColor},${CONFIG.bold},${CONFIG.italic},${CONFIG.underline},${CONFIG.strikeout},${CONFIG.scaleX},${CONFIG.scaleY},${CONFIG.spacing},${CONFIG.angle},${CONFIG.borderStyle},${CONFIG.outline},${CONFIG.shadow},${CONFIG.alignment},${CONFIG.marginL},${CONFIG.marginR},${CONFIG.marginV},1
Style: HookTitle,${CONFIG.fontName},${CONFIG.hookTitleFontSize},&H${CONFIG.hookTitleColor},&H${CONFIG.outlineColor},&H${CONFIG.outlineColor},&H${CONFIG.backgroundColor},1,${CONFIG.italic},${CONFIG.underline},${CONFIG.strikeout},${CONFIG.scaleX},${CONFIG.scaleY},${CONFIG.spacing},${CONFIG.angle},${CONFIG.borderStyle},${CONFIG.outline},${CONFIG.shadow},${CONFIG.hookTitleAlignment},${CONFIG.marginL},${CONFIG.marginR},${CONFIG.hookTitleMarginV},1
Style: CTA,${CONFIG.fontName},${CONFIG.ctaFontSize},&H${CONFIG.ctaColor},&H${CONFIG.outlineColor},&H${CONFIG.outlineColor},&H${CONFIG.backgroundColor},1,${CONFIG.italic},${CONFIG.underline},${CONFIG.strikeout},${CONFIG.scaleX},${CONFIG.scaleY},${CONFIG.spacing},${CONFIG.angle},${CONFIG.borderStyle},${CONFIG.outline},${CONFIG.shadow},${CONFIG.ctaAlignment},${CONFIG.marginL},${CONFIG.marginR},${CONFIG.ctaMarginV},1

[Events]
Format: Layer, Start, End, Style, Name, MarginL, MarginR, MarginV, Effect, Text
`;

// Add hook title at the beginning
const hookTitle = clip.text_styling?.hook_title_overlay || clip.title;
const hookEndTime = Math.min(CONFIG.hookTitleDuration, clip.duration);
ass += `Dialogue: 1,${formatTime(0)},${formatTime(hookEndTime)},HookTitle,,0,0,0,,${hookTitle.replace(/\n/g, '\\N')}\n`;

// Add all word-by-word dialogue lines
dialogueLines.forEach(line => {
  ass += `Dialogue: 0,${line.formattedStart},${line.formattedEnd},Default,,0,0,0,,${line.text}\n`;
});

// Add CTA at the end
const ctaText = clip.text_styling?.cta_promise_text || 'Watch the full video';
const ctaStartTime = Math.max(0, clip.duration - CONFIG.ctaDuration);
ass += `Dialogue: 2,${formatTime(ctaStartTime)},${formatTime(clip.duration)},CTA,,0,0,0,,${ctaText}\n`;

const assPath = `/nas/PeggysExtraStorage/videos-to-process/scratch/subtitle_clip_${taskId}_${String(clip.index).padStart(2, '0')}.ass`;

return [{
  json: {
    ...data,
    ass_path: assPath,
    subtitle_generated: true,
    total_words: allWords.length,
    total_groups: wordGroups.length,
    total_dialogue_lines: dialogueLines.length
  },
  binary: {
    data: {
      data: Buffer.from(ass).toString('base64'),
      mimeType: 'text/x-ssa',
      fileName: `subtitle_clip_${taskId}_${String(clip.index).padStart(2, '0')}.ass`
    }
  }
}];

// Apply ASS subtitles to the no-subs video
const data = $input.first().json;

const finalCmd = `ffmpeg -y -i "${data.output_path_nosubs}" \\
    -vf "ass='${data.ass_path}'" \\
    -c:v libx264 -crf 23 -preset fast \\
    -c:a copy \\
    -movflags +faststart \\
    "${data.output_path_final}"`;

return [{
  json: {
    ...data,
    final_ffmpeg_command: finalCmd
  }
}];

// Verify clip was created by checking ffmpeg exit code
const execResult = $input.first().json;
const exitCode = execResult.exitCode;

// Get clip data from Build Final ffmpeg Command node
const buildData = $('Build Final ffmpeg Command').item.json;
const clip = buildData.clip;

// ffmpeg returns 0 on success
if (exitCode === 0) {
  return [{
    json: {
      clip_index: clip.index,
      clip_title: clip.title,
      output_path_nosubs: buildData.output_path_nosubs,
      output_path_final: buildData.output_path_final,
      duration: clip.duration,
      status: 'success',
      ai_output: buildData.ai_output
    }
  }];
} else {
  return [{
    json: {
      clip_index: clip.index,
      clip_title: clip.title,
      status: 'failed',
      error: `ffmpeg failed with exit code ${exitCode}`,
      stderr: execResult.stderr || 'No error output',
      ai_output: buildData.ai_output
    }
  }];
}

// Aggregate all clip results
const allClips = $input.all();
const successful = allClips.filter(c => c.json.status === 'success');
const failed = allClips.filter(c => c.json.status === 'failed');

// Get ai_output from first item (all items have the same ai_output)
const aiOutput = allClips[0]?.json.ai_output;

return [{
  json: {
    total_clips: allClips.length,
    successful_clips: successful.length,
    failed_clips: failed.length,
